import React from 'react'
import './services.scss'

export default function Services() {
    const serviceList = [
        {
            name: "Windows Virtual Machine",
            desc: "Our Bs-series VMs provide an economical, low-cost solution for workloads that normally don't use a lot of CPU, but occasionally need to burst to handle higher workloads. Free for 12 months.",
            specs: ["B1S", "1 vCPU(s)", "1 GiB RAM"],
            price: 0.008
        },
        {
            name: "Linux Virtual Machine",
            desc: "Fsv2 is our newest compute-optimized VM family and uses the Intel Skylake processor. Fsv2 delivers the latest Intel CPU for raw compute power.",
            specs: ["F2s v2", "2 vCPU(s)", "4 GiB RAM"],
            price: 0.085
        },
        {
            name: "Linux Virtual Machine",
            desc: "Our Dv3 family is the latest generation of our general purpose VMs. It's appropriate for a variety of workloads.",
            specs: ["D2 v3", "2 vCPU(s)", "8 GiB RAM"],
            price: 0.096
        },
        
    ]
    return (
        <div>
            <h1>Services</h1>
        </div>
    )
}
